import React, { Component } from "react";
import MainHeader from "./MainHeader";
import Dashboard from "./Dashboard";

export class MainPage extends Component {
  render() {
    return (
      <div>
        <div>
          <MainHeader></MainHeader>
        </div>
        <div>
          <Dashboard></Dashboard>
        </div>
      </div>
    );
  }
}

export default MainPage;
